import Login from "./components/Login";
import Register from "./components/Register";
import "./style/App.css";
import { BrowserRouter as Router, Link, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Register />
        <Login />
      </Router>
    </div>
  );
}

export default App;
